import React from "react";

function CharStrengths( { teamChars } ) {


    const charStrengths = teamChars.map((char) => {
        const filler = char.strengths.keywords.sort().map((word) => {
            return (
                    <ul className="details">+{word}</ul>
            )
        })
        return (
            <td>{filler}</td>
        )
    })

    return (
        <>
            {charStrengths}
            {teamChars[0]?null:<td/>}
            {teamChars[1]?null:<td/>}
            {teamChars[2]?null:<td/>}
        </>
    )
}

export default CharStrengths ; filler
